- Governo FHC: 1 invasão por dia;
- Governo Lula: 20 invasões por mês;
- Governo Bolsonaro: 5 invasões por ano.

. O MST perdeu sua força quando Jair Bolsonaro começou a titular os assentados.
Em 3,5 anos Bolsonaro já distribuiu 402 mil títulos, sendo que 80% desses foram para as mulheres.

