-EMPREGOS (comparação): 

- BOLSONARO:

. Maior número de brasileiros trabalhando na história: 100,2 milhões (junho/2022);

. Menor desemprego em 7 anos: 9,1% em julho/2022 (mesmo com pandemia e guerra);

. Saldo de mais de 5,5 milhões de empregos após maior crise mundial (desde jul/2020);

. Reduções de impostos e apoio a mais de 10 milhões de empresas na pandemia (fique em casa que a economia a gente vê depois);

. Último ano e meio de Bolsonaro:

. (2021/2022): 4,59 milhões de empregos gerados;

. 2021: +2,76 milhões de empregos
. 2022: +1,83 milhões de empregos (até agosto)

- LULA E PT:

. Maior recessão econômica da história do Brasil;

. Desemprego recorde antes do Bolsonaro: 13,9% em março/2017;

. Resultado das más escolhas e das políticas econômicas erradas do passado;

. Corrupção e incompetência destruindo o Brasil;

. Agro desprezado e indústrias achacadas por burocracias e impostos;

. 2 últimos anos do PT (2015/2016):

. 2,87 milhões de empregos perdidos
. 2015: -1.55 milhões de empregos
. 2016: -1,32 milhões de empregos

